    }()
    var cachePolicy: URLRequest.CachePolicy = .useProtocolCachePolicy
    
    // MARK: viewDidLoad

    override func viewDidLoad() {
        super.viewDidLoad()
        
        // Clear the shared cache
        URLCache.shared.removeAllCachedResponses()
        
        print(Date())
    }
    
    // MARK: Public Functions
    
    @IBAction func sendRequest1(_ sender: Any) {
        getResponse(request: request(geometry: geometry1))
    }

    @IBAction func sendRequest2(_ sender: Any) {
        getResponse(request: request(geometry: geometry2))
    }
    
    @IBAction func toggleCachePolicy(_ sender: UISegmentedControl) {
        if (sender.selectedSegmentIndex == 0) {
            cachePolicy = .useProtocolCachePolicy
        }
        else if (sender.selectedSegmentIndex == 1) {
            cachePolicy = .reloadIgnoringLocalCacheData
        }
    }
    
    
    // MARK: Private Functions

    private func request(geometry: String) -> URLRequest {
        var queryParameters = [String: String]()
        queryParameters["f"] = "json"
        queryParameters["geometry"] = geometry
        queryParameters["geometryType"] = "esriGeometryPolygon"
        queryParameters["inSR"] = "3857"
        queryParameters["spatialRel"] = "esriSpatialRelIntersects"
        queryParameters["returnCountOnly"] = "true"
        
        let url = URL(string: "https://services5.arcgis.com/N82JbI5EYtAkuUKU/arcgis/rest/services/FeatureSetByName_iOS/FeatureServer/0/query")!
        var request = URLRequest(url: url)
        request.cachePolicy = cachePolicy
        request.httpMethod = "POST"
        request.httpBody = {
            var comps = URLComponents()
            comps.queryItems = queryParameters.map(URLQueryItem.init(name:value:))
            return comps.percentEncodedQuery?.data(using: .utf8)
        }()
        return request
    }
    
    private func getResponse(request: URLRequest) {
        //
        // Clear response label
        updateResponse(string: "")
        
        // Create dataTask to get the response
        let dataTask = session.dataTask(with: request) { [weak self] (data, response, error) in
            guard let self = self else { return }
            if let error = error {
                self.updateResponse(string: error.localizedDescription)
                return
            }
            
            if let data = data, let _ = response as? HTTPURLResponse {
                if let deserializedJSON = try? JSONSerialization.jsonObject(with: data, options: []) as? [String: Any],
                    let resultCount = deserializedJSON["count"] {
                    let resultString = "Count: \(resultCount)"
                    self.updateResponse(string: resultString)
                }
            }
        }
        dataTask.resume()
    }
    
    private func updateResponse(string: String) {
        DispatchQueue.main.asyncAfter(deadline: .now()) {
            self.responseLabel.text = string
        }
    }
    
